@CH--NguyenThanhAnđúng rồi 
Skill là chiêu thức
Còn skin là trang phục:))😂

@austinnguyen9107what a dumb takeaway lol. Doran is low resources top laner. He shines the most absorbing pressure off from the rest of the team and still performs enough in team fights.

Funny thing is even when he gets resources from team like in game 5 he performs as he’s expected to, locking in targets and disrupting team fights. Even if he has a lot of mistakes those never costed too much to the team and he still performed when it mattered.

Doran gained his spot in the roster and he deserves that trophy without a doubt.
